--
-- Definition for procedure usp_a20xx_v2_event_summary
--
DROP PROCEDURE IF EXISTS usp_a20xx_v2_event_summary$$
CREATE DEFINER = 'root'@'%'
PROCEDURE usp_a20xx_v2_event_summary(IN lsevent_id INT)
BEGIN
  DROP TABLE IF EXISTS TMP2; 
  DROP TABLE IF EXISTS WRK;

  CREATE TEMPORARY TABLE WRK (
    rank INT,
    games_played INT,
    guid varchar(255), 
    scheduled datetime, 
    team_score int,
    team_name nvarchar(255),
    team_id int,
    series_id int 
  );

  CREATE TEMPORARY TABLE TMP_PNTS_BY_GAME (
    seq INT,
    rank INT,
    prev INT,
    games_played INT,
    guid varchar(255), 
    scheduled datetime, 
    team_score int,
    team_name nvarchar(255),
    team_id int,
    series_id int 
  );

  SELECT
    0, 1, guid, m.scheduled, COALESCE(score_override, SUM(score)) AS team_score, t.team_name, t.id, s.id 
  FROM 
    lsdrep.matches m 
    INNER JOIN
      match_teams mt ON m.id = mt.match_id
    INNER JOIN teams t ON 
      mt.team_id = t.id AND m.lsevent_id = t.lsevent_id
    INNER JOIN lsevent_players lp ON
      lp.lsevent_id = m.lsevent_id AND lp.team_id = t.id
    INNER JOIN match_players mp ON
      mp.match_id = m.id AND mp.player_id = lp.player_id
    LEFT OUTER JOIN series s ON
      s.lsevent_id = m.lsevent_id AND m.series_id = s.id
  WHERE 
    m.lsevent_id = lsevent_id AND t.team_name <> lp.alias
  GROUP BY
    guid, m.scheduled, t.team_name
  ORDER BY  
    m.scheduled, COALESCE(score_override, SUM(score)) ASC, team_name;
  
  SET @seq := 0, @rank := 1, @prev := 999999999, @prevGuid := ''; /* Init Ranking Code */
  SELECT 
    @seq := if(@prevGuid = guid, @seq+1, 1) AS seq
  , @rank := if(@prev = team_score, @rank, @seq) AS Rank
  , @prev := team_score AS prev
  , @prevGuid := guid as guid
  , t.games_played, t.scheduled, t.team_score, t.team_name, t.team_id, t.series_id
  FROM WRK t;

  /*SELECT rank, guid, games_played, scheduled, team_score, team_name, team_id, series_id FROM TMP_PNTS_BY_GAME;*/

  CREATE TEMPORARY TABLE TMP_EVT_SUM (
    sort_order int,
    series_name nvarchar(255),
    series_id int,
    team_name nvarchar(255),
    games_played INT,
    tournament_points INT,
    team_score_sum INT
  );

  SELECT 
    0, 'event', 0, team_name, COUNT(tg.games_played), SUM(rank) AS pnts, SUM(team_score) 
  FROM 
    (SELECT rank-1 as rank, team_name, games_played, team_score FROM TMP_PNTS_BY_GAME) tg
  GROUP BY 
    team_name
  ORDER BY 
    SUM(rank) DESC;
  
  SELECT 
    1, s.name, s.id, team_name, COUNT(tg.games_played), SUM(rank) AS pnts, SUM(team_score) 
  FROM 
    (SELECT rank-1 as rank, team_name, games_played, team_score, series_id FROM TMP_PNTS_BY_GAME) tg
    INNER JOIN
      series s ON tg.series_id = s.id
  GROUP BY 
    team_name, tg.series_id
  ORDER BY 
    SUM(rank) DESC;
  
  SET @seq := 0, @rank := 1, @prev := 999999999, @prevSeriesId := -1; /* Init Ranking Code */

  SELECT 
    @seq := if(@prevSeriesId = t.series_id, @seq+1, 1) AS seq
    , @rank := if((@prev = t.tournament_points AND @prevSeriesId = t.series_id), @rank, @seq) AS rank
    , @prev := tournament_points AS prev
    , @prevSeriesId := series_id as series_id
    , t.* 
  FROM 
    TMP_EVT_SUM t
  ORDER BY 
    sort_order, series_name, tournament_points DESC;
  DROP TABLE TMP_EVT_SUM;
  DROP TABLE TMP_PNTS_BY_GAME;
  DROP TABLE WRK;
END
$$

--
-- Definition for procedure usp_a20xx_v2_game_details
--
DROP PROCEDURE IF EXISTS usp_a20xx_v2_game_details$$
CREATE DEFINER = 'root'@'%'
PROCEDURE usp_a20xx_v2_game_details(IN lsevent_id INT)
BEGIN
  DROP TABLE IF EXISTS TMP2; 
  DROP TABLE IF EXISTS WRK;

  /* SELECT * FROM TCNT; */
  CREATE TEMPORARY TABLE WRK (
    series_name nvarchar(255),
    match_id int,
    scheduled datetime, 
    color varchar(255), 
    team_name nvarchar(255),
    alias nvarchar(255),
    score INT
  );

    WRK (series_name, match_id, scheduled, color, team_name, alias, score ) 
  SELECT
    s.name, m.id, m.scheduled, p.color, t.team_name, lp.alias, mp.score
  FROM 
    lsdrep.matches m 
    INNER JOIN
      match_teams mt ON m.id = mt.match_id
    INNER JOIN teams t ON 
      mt.team_id = t.id AND m.lsevent_id = t.lsevent_id
    INNER JOIN lsevent_players lp ON
      lp.lsevent_id = m.lsevent_id AND lp.team_id = t.id
    INNER JOIN match_players mp ON
      mp.match_id = m.id AND mp.player_id = lp.player_id
    INNER JOIN players pl ON
      pl.id = mp.player_id
    LEFT OUTER JOIN series s ON
      s.lsevent_id = m.lsevent_id AND m.series_id = s.id
    LEFT OUTER JOIN packsets p 
      ON p.id = mt.packset_id
  WHERE 
    m.lsevent_id = lsevent_id AND t.team_name <> lp.alias
  GROUP BY
    guid, m.scheduled, t.team_name, lp.alias
  ORDER BY  
    m.scheduled, score DESC, lp.alias, team_name;

  SET @seq := 1, @rank := 1, @prev := 999999999, @prevMid := 0; /* Init Ranking Code */
  SELECT
    @seq := if(@prevMid = match_id, @seq+1, 1) AS seq
  , @rank := if(@prev = score, @rank, @seq) AS rank
  , @prev := score AS prevScore
  , @prevMid := match_id as prevMid
  , w.*
  FROM WRK w;    
  DROP TABLE WRK;
END
$$

