    packset_color varchar(100) 
  );

  SELECT
    0, 1, guid, m.scheduled, COALESCE(score_override, SUM(score)) AS team_score, t.team_name, t.id, s.id, p.id , p.color 
  FROM 
    lsdrep.matches m 
    INNER JOIN
      match_teams mt ON m.id = mt.match_id
    INNER JOIN teams t ON 
      mt.team_id = t.id AND m.lsevent_id = t.lsevent_id
